function User(){

    React.useEffect(()=>{
        const regBtn = document.getElementById('regBtn');
        const loginBtn = document.getElementById('loginBtn');

        userUtils.handleUserHeader(window.location.search === '?login');
        console.log(window.location.search === '?login')
    });

