        <div className='content_block'>
            <div className='user_header'>
                <Link to='/user?register'><label id='regBtn'>Register</label></Link>
                <Link to='/user?login' ><label id='loginBtn'>Login</label></Link>
            </div>
            <div className='user_content'>

            </div>
        </div>
    );
}

